import React from "react";
import { StyleSheet } from "react-native";

export const style = StyleSheet.create({
    content: {
        width: '60vw',
        height: '50vh',
        right: '1rem',
        top: '3rem',
        backgroundColor: 'black',
        display: 'flex',
        flexDirection: 'column',
        gap: '2rem',
        border: '2px solid gray',
        position: "absolute",
        transform: "animate all 1s"
    }
})
